(122, 36, 'mfn-page-items-seo', '<img src=\"http://antflower.sk/wp-content/uploads/2014/11/about-us-top-image3.png\" alt=\"about-us-top-image3\"/>\n\ncenter\n\n<img src=\"http://antflower.sk/wp-content/uploads/2017/02/logo-orj@1x.png\" alt=\"logo-orj@1x\"/>\n\ncenter\n\n30\n\nfadeInLeft\n\n<h2>About<br />Us</h2>\r\n[divider height=\"30\"]\r\n<h5>Florist Antflower been on the market since 2002, located in the shopping center Hypermarket Nitra.</h5>\r\n<h5>Since 2006 we are direct importers of cut and potted flowers directly from Holland. The flowers we buy the largest stock exchanges in the Netherlands. We offer our customers the freshness and quality at a high level because dodávataľmi directly growers and producers of flowers in the Netherlands.\r\n<br><br>\r\nClients are trying to reach mainly own products and flower composition, dried decorations suitable for the full year.</h5>\n\nno-repeat;center top;;\n\nauto\n\ndefault\n\n<h5>You offer also many artificial flowers, pots, containers and vases, statues, handmade candles, a variety of gift subject decorations.\r\n<br><br>\r\nWe offer a complete floral decoration wedding: wedding bouquet, decorations for cars, decoration of churches, wedding hall and floral decorations graduations ceremonies, receptions, restaurants, cafes ...</h5>\n\nno-repeat;center top;;\n\nauto\n\n<img src=\"http://antflower.sk/wp-content/uploads/2014/11/about-us-mission-image-1.png\" alt=\"about-us-mission-image\"/>\n\nfadeInRight\n\ndefault\n\n<img src=\"http://antflower.sk/wp-content/uploads/2014/11/about-us-vission-image.png\" alt=\"about-us-vission-image\"/>\n\nfadeInLeft\n\n<h5>In his work we use the latest trends in modern floristry. Exclusive bouquets, wedding bouquets, congratulatory bouquets, mourning floristry, not only from live flowers, but also from dried flowers.\r\n<br><br>\r\nRegular customers we offer loyalty discounts up to 15%.\r\n<br><br>\r\nIn our offer we also offer a delivery kvetovpriamo the house. To someone pleasantly surprise or to repay loved ones, friends or family? Nicely choreographed bouquet Antflower certainly make you happy.</h5>\n\nno-repeat;center top;;\n\nauto\n\n'),
