(2788, 268, 'mfn-page-items-seo', '<img src=\"http://antflower.sk/wp-content/uploads/2014/11/about-us-top-image3.png\" alt=\"about-us-top-image3\"/>\n\ncenter\n\n<img src=\"http://antflower.sk/wp-content/uploads/2017/02/logo-orj@1x.png\" alt=\"logo-orj@1x\"/>\n\ncenter\n\n30\n\nfadeInLeft\n\n<h2>O<br />Nás</h2>\r\n[divider height=\"30\"]\r\n<h5>Kvetinárstvo Antflower pôsobí na trhu od roku 2002, nachádza v nákupnom centre Hypermarket Nitra.</h5>\r\n<h5>Od roku 2006 sme priamym dovozcom rezaných a črepníkových kvetov priamo z Holandska. Kvety nakupujeme na najväčších burzách v Holandsku. Našim zákazníkom ponúkame čerstvosť a kvalitu na vysokej úrovni, pretože dodávataľmi sú priamo pestovatelia a výrobcovia kvetov v Holandsku.\r\n<br><br>\r\nKlientelu sa snažíme osloviť hlavne vlastnými výrobkami a to kvetinovými kompozíciami, sušenými dekoráciami vhodnými na celoročné obdobie.</h5>\n\nno-repeat;center top;;\n\nauto\n\ndefault\n\n<h5>V našej ponuke nájdete taktiež množstvo umelých kvetov, črepníkov, obalov a váz, sošiek, ručne vyrábaných sviečok, rôznych darčekových predmetova dekorácií.\r\n<br><br>\r\nPonúkame kompletnú kvetinovú výzdobu svadieb: svadobná kytica, dekorácie na autá, výzdobu kostolov, svadobných sál ako aj kvetinovú výzdobu stužkových slávností, recepcií, reštaurácií, kaviarní ...</h5>\n\nno-repeat;center top;;\n\nauto\n\n<img src=\"http://antflower.sk/wp-content/uploads/2014/11/about-us-mission-image-1.png\" alt=\"about-us-mission-image\"/>\n\nfadeInRight\n\ndefault\n\n<img src=\"http://antflower.sk/wp-content/uploads/2014/11/about-us-vission-image.png\" alt=\"about-us-vission-image\"/>\n\nfadeInLeft\n\n<h5>Vo svojej práci využívame najnovšie trendy v modernej floristike. Exkluzívne kytice, svadobné kytice, gratulačné kytice, smútočná floristika, nielen zo živých kvetov, ale aj zo sušených kvetov.\r\n<br><br>\r\nStálym zákazníkom poskytujeme vernostné zľavy až do výšky 15 %.\r\n<br><br>\r\nV rámci našej ponuky ponúkame aj donášku kvetovpriamo do domu. Chcete niekoho milo prekvapiť alebo sa chcete odvďačiť blízkym, priateľom či rodine? Pekne naaranžovaná kytica z Antflower im určite urobí radosť.</h5>\n\nno-repeat;center top;;\n\nauto\n\n'),
